    t[193] = "\u0410\u0431\u0441\u043e\u043b\u044e\u0442\u043d\u044b\u0439 \u043f\u0443\u0442\u044c \u0434\u043e \u0444\u0430\u0439\u043b\u0430, \u0441\u043e\u0434\u0435\u0440\u0436\u0430\u0449\u0435\u0433\u043e \u0444\u0438\u043b\u044c\u0442\u0440\u044b";
    t[202] = "Host not set";
    t[203] = "\u0425\u043e\u0441\u0442 \u043d\u0435 \u0437\u0430\u0434\u0430\u043d";
    t[204] = "Registration Helper";
    t[205] = "\u041f\u043e\u043c\u043e\u0449\u043d\u0438\u043a \u0440\u0435\u0433\u0438\u0441\u0442\u0440\u0430\u0446\u0438\u0438";
    t[206] = "You can do this by clicking the Start button on the main page which corresponds to the new tunnel.";
    t[207] = "\u0412\u044b \u043c\u043e\u0436\u0435\u0442\u0435 \u044d\u0442\u043e \u0441\u0434\u0435\u043b\u0430\u0442\u044c, \u043d\u0430\u0436\u0430\u0432 \u043a\u043d\u043e\u043f\u043a\u0443 \"\u041f\u0443\u0441\u043a\" \u043d\u0430 \u0433\u043b\u0430\u0432\u043d\u043e\u0439 \u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0435, \u043a\u043e\u0442\u043e\u0440\u0430\u044f \u043e\u0442\u0432\u0435\u0447\u0430\u0435\u0442 \u0437\u0430 \u043d\u043e\u0432\u044b\u0439 \u0442\u0443\u043d\u043d\u0435\u043b\u044c.";
    t[208] = "Level of Randomization for Tunnel Depth";
    t[209] = "\u0423\u0440\u043e\u0432\u0435\u043d\u044c \u0441\u043b\u0443\u0447\u0430\u0439\u043d\u043e\u0433\u043e \u0440\u0430\u0437\u0431\u0440\u043e\u0441\u0430 \u0434\u043b\u0438\u043d\u044b \u0442\u0443\u043d\u043d\u0435\u043b\u044f";
    t[214] = "Advanced tunnel, streaming, and I2CP options";
    t[215] = "\u0420\u0430\u0441\u0448\u0438\u0440\u0435\u043d\u043d\u044b\u0435 \u043d\u0430\u0441\u0442\u0440\u043e\u0439\u043a\u0438 \u0442\u0443\u043d\u043d\u0435\u043b\u0435\u0439, \u0441\u0442\u0440\u0438\u043c\u0438\u043d\u0433\u0430 \u0438 I2CP";
    t[216] = "Enable Direct Client-to-Client protocol. Note that this will compromise your anonymity and is <i>not</i> recommended.";
    t[217] = "\u0412\u043a\u043b\u044e\u0447\u0438\u0442\u044c \u043f\u0440\u043e\u0442\u043e\u043a\u043e\u043b Direct Client-to-Client. \u0412\u043d\u0438\u043c\u0430\u043d\u0438\u0435: \u044d\u0442\u043e \u0441\u043a\u043e\u043c\u043f\u0440\u043e\u043c\u0435\u0442\u0438\u0440\u0443\u0435\u0442 \u0432\u0430\u0448\u0443 \u0430\u043d\u043e\u043d\u0438\u043c\u043d\u043e\u0441\u0442\u044c, \u0432\u043a\u043b\u044e\u0447\u0430\u0442\u044c <i>\u043d\u0435</i> \u0440\u0435\u043a\u043e\u043c\u0435\u043d\u0434\u0443\u0435\u0442\u0441\u044f.";
    t[218] = "Port required to access service (this can be a different port to the port the service is hosted on)";
    t[219] = "\u041f\u043e\u0440\u0442 \u0434\u043b\u044f \u0434\u043e\u0441\u0442\u0443\u043f\u0430 \u043a \u0441\u0435\u0440\u0432\u0438\u0441\u0443 (\u043c\u043e\u0436\u0435\u0442 \u0431\u044b\u0442\u044c \u043e\u0442\u043b\u0438\u0447\u0435\u043d \u043e\u0442 \u043f\u043e\u0440\u0442\u0430, \u043d\u0430 \u043a\u043e\u0442\u043e\u0440\u043e\u043c \u0440\u0430\u0437\u043c\u0435\u0449\u0430\u0435\u0442\u0441\u044f \u0441\u0435\u0440\u0432\u0438\u0441)";
    t[226] = "Generate a QR Code for this domain";
    t[227] = "\u0421\u043e\u0437\u0434\u0430\u0442\u044c QR-\u043a\u043e\u0434 \u0434\u043b\u044f \u044d\u0442\u043e\u0433\u043e \u0434\u043e\u043c\u0435\u043d\u0430";
    t[230] = "Website name";
    t[231] = "\u0418\u043c\u044f \u0432\u0435\u0431-\u0441\u0430\u0439\u0442\u0430";
    t[232] = "Cancel the wizard and return to Tunnel Manager home page";
    t[233] = "\u0421\u0431\u0440\u043e\u0441\u0438\u0442\u044c \u043c\u0430\u0441\u0442\u0435\u0440 \u0438 \u0432\u043e\u0437\u0432\u0440\u0430\u0442\u0438\u0442\u044c\u0441\u044f \u043d\u0430 \u0433\u043b\u0430\u0432\u043d\u0443\u044e \u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0443 \u041c\u0435\u043d\u0435\u0434\u0436\u0435\u0440\u0430 \u0422\u0443\u043d\u043d\u0435\u043b\u0435\u0439";
    t[236] = "Total";
    t[237] = "\u0412\u0441\u0435\u0433\u043e";
    t[242] = "Enables direct chat and file transfers, bypassing I2P";
    t[243] = "\u0418\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u044c \u0447\u0430\u0442 \u0438 \u043f\u0435\u0440\u0435\u0434\u0430\u0432\u0430\u0442\u044c \u0444\u0430\u0439\u043b\u044b \u043d\u0430\u043f\u0440\u044f\u043c\u0443\u044e, \u043d\u0435 \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u044f I2P";
    t[250] = "Authentication for adding subdomain";
    t[251] = "\u0410\u0443\u0442\u0435\u043d\u0442\u0438\u0444\u0438\u043a\u0430\u0446\u0438\u044f \u0434\u043b\u044f \u0434\u043e\u0431\u0430\u0432\u043b\u0435\u043d\u0438\u044f \u043f\u043e\u0434\u0434\u043e\u043c\u0435\u043d\u0430";
    t[256] = "Disable";
    t[257] = "\u0412\u044b\u043a\u043b\u044e\u0447\u0438\u0442\u044c";
    t[258] = "The router will start the tunnel once it has been set up.";
    t[259] = " \u041c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440 \u0437\u0430\u043f\u0443\u0441\u0442\u0438\u0442\u0441\u044f \u043a\u0430\u043a \u0442\u043e\u043b\u044c\u043a\u043e \u0431\u0443\u0434\u0435\u0442 \u0441\u043e\u0437\u0434\u0430\u043d \u0442\u0443\u043d\u043d\u0435\u043b\u044c.";
    t[264] = "Cancel";
    t[265] = "\u041e\u0442\u043c\u0435\u043d\u0430";
    t[268] = "New Certificate Password";
    t[269] = "\u041d\u043e\u0432\u044b\u0439 \u043f\u0430\u0440\u043e\u043b\u044c \u0441\u0435\u0440\u0442\u0438\u0444\u0438\u043a\u0430\u0442\u0430";
    t[270] = "Prevents server discovery by floodfills";
    t[271] = "\u0417\u0430\u043f\u0440\u0435\u0449\u0430\u0435\u0442 \u043e\u0431\u043d\u0430\u0440\u0443\u0436\u0435\u043d\u0438\u0435 \u0441\u0435\u0440\u0432\u0435\u0440\u043e\u0432 floodfill'\u0430\u043c\u0438.";
    t[276] = "Username";
    t[277] = "\u0418\u043c\u044f \u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u0435\u043b\u044f";
    t[278] = "Send key to all users.";
    t[279] = "\u041e\u0442\u043f\u0440\u0430\u0432\u0438\u0442\u044c \u043a\u043b\u044e\u0447 \u0432\u0441\u0435\u043c \u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u0435\u043b\u044f\u043c.";
    t[280] = "b32 not recommended";
    t[281] = "b32 \u043d\u0435 \u0440\u0435\u043a\u043e\u043c\u0435\u043d\u0434\u0443\u0435\u0442\u0441\u044f";
    t[284] = "Automatically start tunnel when router starts";
    t[285] = "\u0410\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0438 \u0437\u0430\u043f\u0443\u0441\u0442\u0438\u0442\u044c \u0442\u0443\u043d\u043d\u0435\u043b\u044c \u043f\u0440\u0438 \u0441\u0442\u0430\u0440\u0442\u0435 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430";
    t[290] = "Create";
    t[291] = "\u0421\u043e\u0437\u0434\u0430\u0442\u044c";
    t[296] = "If an outproxy plugin is installed (e.g. Orchid), use this instead of any configured outproxies to access websites outside of I2P";
    t[297] = "\u0418\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u044c \u043c\u043e\u0434\u0443\u043b\u044c \u0432\u043d\u0435\u0448\u043d\u0435\u0433\u043e \u043f\u0440\u043e\u043a\u0441\u0438 (\u043d\u0430\u043f\u0440\u0438\u043c\u0435\u0440, Orchid) \u0434\u043b\u044f \u0434\u043e\u0441\u0442\u0443\u043f\u0430 \u043a \u0441\u0430\u0439\u0442\u0430\u043c \u0432\u043d\u0435 I2P \u0432\u043c\u0435\u0441\u0442\u043e \u043b\u044e\u0431\u043e\u0433\u043e \u043d\u0430\u0441\u0442\u0440\u043e\u0435\u043d\u043d\u043e\u0433\u043e outproxy";
    t[304] = "Retain tunnel identity (destination) when tunnels reopen";
    t[305] = "\u0421\u043e\u0445\u0440\u0430\u043d\u044f\u0442\u044c \u0438\u0434\u0435\u043d\u0442\u0438\u0444\u0438\u043a\u0430\u0446\u0438\u043e\u043d\u043d\u044b\u0439 \u0430\u0434\u0440\u0435\u0441 \u0442\u0443\u043d\u043d\u0435\u043b\u044f \u043f\u0440\u0438 \u043f\u0435\u0440\u0435\u0437\u0430\u043f\u0443\u0441\u043a\u0435";
    t[306] = "Separate multiple proxies with commas.";
    t[307] = "\u0420\u0430\u0437\u0434\u0435\u043b\u044f\u0439\u0442\u0435 \u043d\u0435\u0441\u043a\u043e\u043b\u044c\u043a\u043e \u043f\u0440\u043e\u043a\u0441\u0438 \u0437\u0430\u043f\u044f\u0442\u044b\u043c\u0438.";
    t[308] = "Authentication for changing destination";
    t[309] = "\u0410\u0443\u0442\u0435\u043d\u0442\u0438\u0444\u0438\u043a\u0430\u0446\u0438\u044f \u0434\u043b\u044f \u0438\u0437\u043c\u0435\u043d\u0435\u043d\u0438\u044f \u043d\u0430\u0437\u043d\u0430\u0447\u0435\u043d\u0438\u044f";
    t[310] = "bulk connection (downloads/websites/BT)";
    t[311] = "\u043e\u043f\u0442\u0438\u043c\u0438\u0437\u0438\u0440\u043e\u0432\u0430\u0442\u044c \u0434\u043b\u044f \u0431\u043e\u043b\u044c\u0448\u043e\u0433\u043e \u043e\u0431\u044a\u0451\u043c\u0430 (www/bittorrent)";
    t[312] = "Deny User-Agents matching these strings (probably from inproxies)";
    t[313] = "\u0417\u0430\u043f\u0440\u0435\u0442\u0438\u0442\u044c \u0434\u043e\u0441\u0442\u0443\u043f, \u0435\u0441\u043b\u0438 User-Agent \u0438\u0437 \u0441\u043f\u0438\u0441\u043a\u0430 (\u0432\u0435\u0440\u043e\u044f\u0442\u043d\u044b\u0439 inproxy)";
    t[314] = "This enables both TCP and UDP connections to be made through a SOCKS outproxy within I2P.";
    t[315] = "\u042d\u0442\u043e \u043f\u043e\u0437\u0432\u043e\u043b\u044f\u0435\u0442 \u0443\u0441\u0442\u0430\u043d\u0430\u0432\u043b\u0438\u0432\u0430\u0442\u044c \u043a\u0430\u043a TCP, \u0442\u0430\u043a \u0438 UDP \u0441\u043e\u0435\u0434\u0438\u043d\u0435\u043d\u0438\u044f \u0447\u0435\u0440\u0435\u0437 SOCKS outproxy \u0432 I2P.";
    t[318] = "Path to Private Key File";
    t[319] = "\u041f\u0443\u0442\u044c \u0434\u043e \u0441\u0435\u043a\u0440\u0435\u0442\u043d\u043e\u0433\u043e \u0444\u0430\u0439\u043b\u0430 \u043a\u043b\u044e\u0447\u0430";
    t[326] = "Use SSL to connect to target";
    t[327] = "\u0418\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u044c SSL \u0434\u043b\u044f \u043f\u043e\u0434\u043a\u043b\u044e\u0447\u0435\u043d\u0438\u044f \u043a \u0446\u0435\u043b\u0438";
    t[332] = "SSL is enabled";
    t[333] = "SSL \u0432\u043a\u043b\u044e\u0447\u0451\u043d";
    t[334] = "Copy Hostname";
    t[335] = "\u0421\u043a\u043e\u043f\u0438\u0440\u043e\u0432\u0430\u0442\u044c \u0438\u043c\u044f \u0443\u0437\u043b\u0430";
    t[338] = "Listening interface (IP address) for client access (normally 127.0.0.1)";
    t[339] = "\u041f\u0440\u043e\u0441\u043b\u0443\u0448\u0438\u0432\u0430\u0435\u043c\u044b\u0439 \u0438\u043d\u0442\u0435\u0440\u0444\u0435\u0439\u0441 (IP-\u0430\u0434\u0440\u0435\u0441) \u0434\u043b\u044f \u0434\u043e\u0441\u0442\u0443\u043f\u0430 \u043a\u043b\u0438\u0435\u043d\u0442\u0430 (\u043e\u0431\u044b\u0447\u043d\u043e 127.0.0.1)";
    t[344] = "Start";
    t[345] = "\u0417\u0430\u043f\u0443\u0441\u0442\u0438\u0442\u044c";
    t[350] = "If you need to connect to a remote service, such as an IRC server inside I2P or a code repository, then you will require a CLIENT tunnel.";
    t[351] = "\u0415\u0441\u043b\u0438 \u0432\u0430\u043c \u043d\u0435\u043e\u0431\u0445\u043e\u0434\u0438\u043c\u043e \u043f\u043e\u0434\u043a\u043b\u044e\u0447\u0430\u0442\u044c\u0441\u044f \u043a \u0432\u043d\u0435\u0448\u043d\u0435\u043c\u0443 \u0441\u0435\u0440\u0432\u0438\u0441\u0443, \u0442\u0430\u043a\u043e\u043c\u0443 \u043a\u0430\u043a IRC-\u0441\u0435\u0440\u0432\u0435\u0440 \u0432\u043d\u0443\u0442\u0440\u0438 I2P \u0438\u043b\u0438 \u0440\u0435\u043f\u043e\u0437\u0438\u0442\u043e\u0440\u0438\u0439 \u0441 \u043a\u043e\u0434\u043e\u043c, \u0432\u0430\u043c \u043d\u0435\u043e\u0431\u0445\u043e\u0434\u0438\u043c \u041a\u041b\u0418\u0415\u041d\u0422\u0421\u041a\u0418\u0419 \u0442\u0443\u043d\u043d\u0435\u043b\u044c.";
    t[352] = "Hostname or IP address of the target server";
    t[353] = "\u0418\u043c\u044f \u0445\u043e\u0441\u0442\u0430 \u0438\u043b\u0438 IP \u0430\u0434\u0440\u0435\u0441 \u0446\u0435\u043b\u0435\u0432\u043e\u0433\u043e \u0441\u0435\u0440\u0432\u0435\u0440\u0430";
    t[354] = "Encrypted with lookup password";
    t[355] = "\u0417\u0430\u0448\u0438\u0444\u0440\u043e\u0432\u0430\u043d\u043e \u0441 \u043f\u043e\u043c\u043e\u0449\u044c\u044e \u0432\u0440\u0435\u043c\u0435\u043d\u043d\u043e\u0433\u043e \u043f\u0440\u043e\u043c\u0435\u0436\u0443\u0442\u043e\u0447\u043d\u043e\u0433\u043e \u043f\u0430\u0440\u043e\u043b\u044f";
    t[356] = "Enabling this feature will ensure your tunnel identity (destination) remains static, for services offering features based on destination e.g. IRC user authentication";
    t[357] = "\u0412\u043a\u043b\u044e\u0447\u0435\u043d\u0438\u0435 \u044d\u0442\u043e\u0439 \u043e\u043f\u0446\u0438\u0438 \u0441\u0434\u0435\u043b\u0430\u0435\u0442 \u0438\u0434\u0435\u043d\u0442\u0438\u0444\u0438\u043a\u0430\u0446\u0438\u043e\u043d\u043d\u044b\u0439 \u0430\u0434\u0440\u0435\u0441 \u0442\u0443\u043d\u043d\u0435\u043b\u044f \u0441\u0442\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u043c. \u041d\u0435\u043e\u0431\u0445\u043e\u0434\u0438\u043c\u043e \u0434\u043b\u044f \u0441\u0435\u0440\u0432\u0438\u0441\u043e\u0432, \u0430\u0443\u0442\u0435\u043d\u0442\u0438\u0444\u0438\u0446\u0438\u0440\u0443\u044e\u0449\u0438\u0445 \u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u0435\u043b\u044f \u043f\u043e \u0430\u0434\u0440\u0435\u0441\u0443 (IRC)";
    t[358] = "Delay Connect";
    t[359] = "\u0417\u0430\u0434\u0435\u0440\u0436\u043a\u0430 \u0441\u043e\u0435\u0434\u0438\u043d\u0435\u043d\u0438\u044f";
    t[360] = "low redundancy, low resource usage";
    t[361] = "\u043d\u0438\u0437\u043a\u0430\u044f \u0438\u0437\u0431\u044b\u0442\u043e\u0447\u043d\u043e\u0441\u0442\u044c, \u043d\u0438\u0437\u043a\u0430\u044f \u043d\u0430\u0433\u0440\u0443\u0437\u043a\u0430 \u043d\u0430 \u0441\u0438\u0441\u0442\u0435\u043c\u0443";
    t[362] = "Revoke";
    t[363] = "\u041e\u0442\u043e\u0437\u0432\u0430\u0442\u044c";
