    t[968] = "Refresh";
    t[969] = "\u041e\u0431\u043d\u043e\u0432\u0438\u0442\u044c";
    t[970] = "Authentication for adding alias";
    t[971] = "\u0410\u0443\u0442\u0435\u043d\u0442\u0438\u0444\u0438\u043a\u0430\u0446\u0438\u044f \u0434\u043b\u044f \u0434\u043e\u0431\u0430\u0432\u043b\u0435\u043d\u0438\u044f \u043f\u0441\u0435\u0432\u0434\u043e\u043d\u0438\u043c\u0430";
