    t[1055] = "\u041d\u0430\u0441\u0442\u0440\u043e\u0439\u043a\u0438 \u043e\u0431\u0437\u043e\u0440\u0430 \u0430\u0434\u0440\u0435\u0441\u043e\u0432 \u0442\u0443\u043d\u043d\u0435\u043b\u044f";
