    t[1157] = "\u041c\u0430\u0441\u0442\u0435\u0440 \u0442\u0443\u043d\u043d\u0435\u043b\u0435\u0439";
    t[1158] = "Alongside these basic settings, there are a number of advanced options for tunnel configuration.";
    t[1159] = "\u041a\u0440\u043e\u043c\u0435 \u044d\u0442\u0438\u0445 \u043e\u0441\u043d\u043e\u0432\u043d\u044b\u0445 \u043d\u0430\u0441\u0442\u0440\u043e\u0435\u043a \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u0443\u0435\u0442 \u0438 \u043d\u0435\u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u043d\u0430\u0431\u043e\u0440 \u0440\u0430\u0441\u0448\u0438\u0440\u0435\u043d\u043d\u044b\u0445 \u043d\u0430\u0441\u0442\u0440\u043e\u0435\u043a \u0434\u043b\u044f \u043a\u043e\u043d\u0444\u0438\u0433\u0443\u0440\u0430\u0446\u0438\u0438 \u0442\u0443\u043d\u043d\u0435\u043b\u044f.";
