    t[1180] = "When enabled, the accept headers (mime types support) broadcast by your web browser will not be filtered, potentially reducing your anonymity";
    t[1181] = "\u0415\u0441\u043b\u0438 \u0432\u043a\u043b\u044e\u0447\u0435\u043d\u043e, \u0437\u0430\u0433\u043e\u043b\u043e\u0432\u043e\u043a Accept (\u0441\u043f\u0438\u0441\u043e\u043a \u043f\u043e\u0434\u0434\u0435\u0440\u0436\u0438\u0432\u0430\u0435\u043c\u044b\u0445 \u0442\u0438\u043f\u043e\u0432 \u0444\u0430\u0439\u043b\u043e\u0432) \u0432\u0430\u0448\u0438\u0445 \u0432\u0435\u0431-\u0437\u0430\u043f\u0440\u043e\u0441\u043e\u0432 \u043d\u0435 \u0431\u0443\u0434\u0435\u0442 \u043f\u043e\u0434\u0432\u0435\u0440\u0433\u0430\u0442\u044c\u0441\u044f \u0444\u0438\u043b\u044c\u0442\u0440\u0430\u0446\u0438\u0438, \u0447\u0442\u043e \u043f\u043e\u0442\u0435\u043d\u0446\u0438\u0430\u043b\u044c\u043d\u043e \u0443\u043c\u0435\u043d\u044c\u0448\u0438\u0442 \u0432\u0430\u0448\u0443 \u0430\u043d\u043e\u043d\u0438\u043c\u043d\u043e\u0441\u0442\u044c";
    t[1184] = "This will change the name from {0} to {1}, using the same destination";
    t[1185] = "\u042d\u0442\u043e \u0438\u0437\u043c\u0435\u043d\u0438\u0442 \u0438\u043c\u044f \u0441 {0} \u043d\u0430 {1} \u0441 \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043d\u0438\u0435\u043c \u0442\u043e\u0433\u043e \u0436\u0435 \u0430\u0434\u0440\u0435\u0441\u0430 \u043d\u0430\u0437\u043d\u0430\u0447\u0435\u043d\u0438\u044f";
    t[1190] = "Are you sure you want to delete?";
