    t[1194] = "HTTP server";
    t[1195] = "HTTP-\u0441\u0435\u0440\u0432\u0435\u0440";
    t[1198] = "Prevent listed clients from connecting to this service";
    t[1199] = "\u0417\u0430\u043f\u0440\u0435\u0442\u0438\u0442\u044c \u043f\u043e\u0434\u043a\u043b\u044e\u0447\u0435\u043d\u0438\u0435 \u043a\u043b\u0438\u0435\u043d\u0442\u0430\u043c \u0438\u0437 \u0441\u043f\u0438\u0441\u043a\u0430";
    t[1200] = "On the other hand, if you wish to host a service for others to connect to you'll need to create a SERVER tunnel.";
    t[1201] = "\u0421 \u0434\u0440\u0443\u0433\u043e\u0439 \u0441\u0442\u043e\u0440\u043e\u043d\u044b, \u0435\u0441\u043b\u0438 \u0432\u044b \u0441\u043e\u0431\u0438\u0440\u0430\u0435\u0442\u0435\u0441\u044c \u0440\u0430\u0437\u043c\u0435\u0449\u0430\u0442\u044c \u0441\u0435\u0440\u0432\u0438\u0441 \u0434\u043b\u044f \u0434\u0440\u0443\u0433\u0438\u0445, \u0442\u043e \u0432\u044b \u0434\u043e\u043b\u0436\u043d\u044b \u0441\u043e\u0437\u0434\u0430\u0442\u044c \u0421\u0415\u0420\u0412\u0415\u0420\u041d\u042b\u0419 \u0442\u0443\u043d\u043d\u0435\u043b\u044c.";
