    t[1355] = "\u041d\u0435\u043f\u0440\u0430\u0432\u0438\u043b\u044c\u043d\u043e \u043f\u0435\u0440\u0435\u0434\u0430\u043d\u043d\u0430\u044f \u0444\u043e\u0440\u043c\u0430, \u0432\u043e\u0437\u043c\u043e\u0436\u043d\u043e, \u0432\u044b \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043b\u0438 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u0435 \u0431\u0440\u0430\u0443\u0437\u0435\u0440\u0430 \"\u043d\u0430\u0437\u0430\u0434\" \u0438\u043b\u0438 \"\u043e\u0431\u043d\u043e\u0432\u0438\u0442\u044c\". \u041f\u043e\u0436\u0430\u043b\u0443\u0439\u0441\u0442\u0430, \u043f\u043e\u0432\u0442\u043e\u0440\u0438\u0442\u0435 \u043f\u043e\u043f\u044b\u0442\u043a\u0443.";
    t[1356] = "With this tunnel type, IRC networks in I2P can be reached by typing the I2P address into your IRC client, and configuring the IRC client to use this SOCKS tunnel.";
    t[1357] = "\u0421 \u0442\u0443\u043d\u043d\u0435\u043b\u0435\u043c \u0434\u0430\u043d\u043d\u043e\u0433\u043e \u0442\u0438\u043f\u0430 \u043f\u043e\u0434\u043a\u043b\u044e\u0447\u0438\u0442\u044c\u0441\u044f \u043a IRC \u0441\u0435\u0442\u0438 \u0447\u0435\u0440\u0435\u0437 I2P \u043c\u043e\u0436\u043d\u043e, \u043d\u0430\u0431\u0440\u0430\u0432 I2P \u0430\u0434\u0440\u0435\u0441 \u0432 \u0432\u0430\u0448\u0435\u043c IRC \u043a\u043b\u0438\u0435\u043d\u0442\u0435, \u043d\u0430\u0441\u0442\u0440\u043e\u0435\u043d\u043d\u043e\u043c \u0434\u043b\u044f \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043d\u0438\u044f \u044d\u0442\u043e\u0433\u043e SOCKS \u0442\u0443\u043d\u043d\u0435\u043b\u044f.";
    t[1360] = "Edit Server Tunnel Settings for";
    t[1361] = "\u0418\u0437\u043c\u0435\u043d\u0435\u043d\u0438\u0435 \u043d\u0430\u0441\u0442\u0440\u043e\u0435\u043a \u0441\u0435\u0440\u0432\u0435\u0440\u043d\u043e\u0433\u043e \u0442\u0443\u043d\u043d\u0435\u043b\u044f \u0434\u043b\u044f";
