    t[1890] = "Name of tunnel to be displayed on Tunnel Manager home page and the router console sidebar";
    t[1891] = "\u0418\u043c\u044f \u0442\u0443\u043d\u043d\u0435\u043b\u044f, \u043e\u0442\u043e\u0431\u0440\u0430\u0436\u0430\u0435\u043c\u043e\u0435 \u0432 \u041c\u0435\u043d\u0435\u0434\u0436\u0435\u0440\u0435 \u0442\u0443\u043d\u043d\u0435\u043b\u0435\u0439 \u0438 \u043d\u0430 \u043f\u0430\u043d\u0435\u043b\u0438 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430";
    t[1894] = "To enable registration verification, edit tunnel and set name (or website name) to a valid hostname ending in '.i2p'";
